            <table className="w-3/4 mt-10 ml-auto mr-auto">
            <VisitsTableHeader />
                {props.visitors?.filter(v =>v.leavingDate === undefined).map((visitor, index) => (
                <VisitsTableData visitor={ visitor } />
                ))}
            </table>
        );
}
